import React from "react";

import User from "./User/User";

const DUMMY_DATA = [
  { name: "Max", age: 35 },
  { name: "Sam", age: 33 },
  { name: "Ash", age: 25 },
  { name: "Joshua", age: 28 },
];

function App() {
  const [userState, setUserState] = React.useState({
    users: [
      { name: "Max", age: 35 },
      { name: "Sam", age: 33 },
      { name: "Ash", age: 25 },
      { name: "Joshua", age: 28 },
    ],
  });

  const clickHandler = () => {};
  return (
    <div style={{ width: "100%", textAlign: "center", marginTop: "5rem" }}>
      {console.log(userState)}
      <h1>Our Employee</h1>
      <button onClick={clickHandler}>Switch</button>
      <User name={userState[0].name} age={userState[0].age} />
      <User name={userState[1].name} age={userState[1].age}>
        My Favorite Things: Swiming, Racing
      </User>
      <User name={userState[2].name} age={userState[2].age} />
      <User name={userState[3].name} age={userState[3].age} />
    </div>
  );
}

export default App;
